import React, { useEffect, useState } from "react";
import Transaction from "./Transaction";

function TransactionsList() {

  const [transactions, setTransactions] = useState([])

  useEffect(() => {

    fetch('https://localhost:8001/transactions')
      .then((response) => response.json())
      .then((data) => setTransactions(data));
  },[]);


console.log(transactions);
  return (
    <table className="ui celled striped padded table">
      <tbody>
        <tr>
          <th>
            <h3 className="centre aligned">Date</h3>
          </th>
          <th>
            <h3 className="centre aligned">Description</h3>
          </th>
          <th>
            <h3 className="centre aligned">Category</h3>
          </th>
          <th>
            <h3 className="centre aligned">Amount</h3>
          </th>
        </tr>

          {transactions && transactions.map((transaction) => 

                <tr key={transaction.id}>
                <td>
                  <p className="centre aligned">{transaction.date}</p>
                </td>
                <td>
                  <p className="centre aligned">{transaction.description}</p>
                </td>
                <td>
                  <p className="centre aligned">Category</p>
                </td>
                <td>
                  <p className="centre aligned">Amount</p>
                </td>
              </tr>

        )}
      </tbody>
    </table>
  );
}

export default TransactionsList;
